  function createGroup(
    uint8 depth,
    uint256 zeroValue,
    address admin,
    bool canPropose,
    bool canAddData
  ) external onlySupportedDepth(depth) {
    groupCounter++;
    _createGroup(groupCounter, depth, zeroValue);
    groupAdmins[groupCounter] = admin;

